import React from 'react';
import { Link } from 'react-router-dom';
import '../../styles/HomePageCSS/DestinationsSection.css';

// Import hình ảnh
import ganhDaDia from '../../assets/images/ganh_da_dia.jpg';
import baiXep from '../../assets/images/bai_xep.jpg';
import muiDien from '../../assets/images/mui_dien.jpg';
import oLoan from '../../assets/images/o_loan.jpg';
import vungRo from '../../assets/images/vung_ro.jpg';
import mangLang from '../../assets/images/mang_lang.jpg';

const destinations = [
    {
        id: 1,
        name: 'Gành Đá Đĩa',
        category: 'Di tích thiên nhiên',
        image: ganhDaDia,
        rating: 4.8,
        reviews: 245,
        description: 'Kỳ quan thiên nhiên độc đáo với những khối đá xếp chồng lên nhau tạo thành hình lục giác.'
    },
    {
        id: 2,
        name: 'Bãi Xép',
        category: 'Bãi biển',
        image: baiXep,
        rating: 4.7,
        reviews: 189,
        description: 'Bãi biển hoang sơ tuyệt đẹp được yêu thích sau bộ phim "Tôi thấy hoa vàng trên cỏ xanh".'
    },
    {
        id: 3,
        name: 'Mũi Điện',
        category: 'Điểm tham quan',
        image: muiDien,
        rating: 4.6,
        reviews: 210,
        description: 'Ngọn hải đăng cổ nằm trên mũi đất đón ánh bình minh đầu tiên trên đất liền.'
    },
    {
        id: 4,
        name: 'Đầm Ô Loan',
        category: 'Danh lam thắng cảnh',
        image: oLoan,
        rating: 4.5,
        reviews: 178,
        description: 'Đầm nước lợ với các loài hải sản đặc trưng và cảnh quan tuyệt đẹp vào sáng sớm.'
    },
    {
        id: 5,
        name: 'Vũng Rô',
        category: 'Vịnh biển',
        image: vungRo,
        rating: 4.7,
        reviews: 156,
        description: 'Vịnh biển trong xanh được bao bọc bởi núi rừng, từng là cảng tiếp nhận vũ khí lịch sử.'
    },
    {
        id: 6,
        name: 'Nhà Thờ Mằng Lăng',
        category: 'Di tích lịch sử',
        image: mangLang,
        rating: 4.4,
        reviews: 135,
        description: 'Nhà thờ cổ có kiến trúc Gothic, nơi lưu giữ quyển sách chữ quốc ngữ đầu tiên.'
    }
];

// Fallback URLs nếu import hình ảnh gặp vấn đề
const fallbackImages = {
    ganhDaDia: "https://dulich.phuyen.gov.vn/uploads/images/GANH%20DA%20DIA%20%20du%20lich%20Phu%20Yen%20800.jpg",
    baiXep: "https://dulich.phuyen.gov.vn/uploads/images/P1010012.jpg",
    muiDien: "https://dulich.phuyen.gov.vn/uploads/images/mui%20dien%202.jpg",
    oLoan: "https://dulich.phuyen.gov.vn/uploads/images/Mt.jpg",
    vungRo: "https://dulich.phuyen.gov.vn/uploads/images/vung%20ro%20tourism%20(7).jpg",
    mangLang: "https://dulich.phuyen.gov.vn/uploads/images/nha-tho-mang-lang-3.jpg"
};

const DestinationsSection = () => {
    // Hiển thị rating với sao
    const renderRatingStars = (rating) => {
        return (
            <span className="stars">
                {[...Array(5)].map((_, i) => (
                    <i key={i} 
                       className={`bi ${
                           i < Math.floor(rating) ? 'bi-star-fill' : 
                           i < rating ? 'bi-star-half' : 'bi-star'
                       }`}>
                    </i>
                ))}
            </span>
        );
    };

    // Xử lý lỗi khi load hình ảnh
    const handleImageError = (e, type) => {
        e.target.src = fallbackImages[type];
    };

    return (
        <section className="destinations-section">
            <div className="container">
                <div className="section-header">
                    <h2 className="section-title">Địa Điểm Nổi Bật</h2>
                    <p className="section-subtitle">
                        Khám phá những điểm đến tuyệt vời nhất của Phú Yên, từ bãi biển hoang sơ đến các di tích lịch sử văn hóa độc đáo
                    </p>
                </div>
                
                <div className="row">
                    {destinations.map(destination => (
                        <div className="col-md-6 col-lg-4 mb-4" key={destination.id}>
                            <div className="destination-card">
                                <div className="destination-image">
                                    <img 
                                        src={destination.image} 
                                        onError={(e) => handleImageError(e, Object.keys(fallbackImages)[destination.id-1])}
                                        alt={destination.name} 
                                    />
                                    <div className="destination-category">{destination.category}</div>
                                </div>
                                <div className="destination-content">
                                    <div className="destination-rating">
                                        {renderRatingStars(destination.rating)}
                                        <span className="rating-text">{destination.rating} ({destination.reviews} đánh giá)</span>
                                    </div>
                                    <h3 className="destination-title">{destination.name}</h3>
                                    <p className="destination-description">{destination.description}</p>
                                    <Link to={`/locations/${destination.id}`} className="btn btn-sm btn-outline destination-btn">
                                        <span>Xem chi tiết</span>
                                        <i className="bi bi-arrow-right"></i>
                                    </Link>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
                
                <div className="text-center mt-5">
                    <Link to="/locations" className="btn btn-primary btn-view-all">
                        <span>Xem tất cả điểm đến</span>
                        <i className="bi bi-arrow-right-circle-fill ms-2"></i>
                    </Link>
                </div>
            </div>
        </section>
    );
};

export default DestinationsSection;
